import React from 'react';

const Dashboard = () => {
  return (
    <div className="dashboard">
      <h2>Welcome to your Dashboard</h2>
      <p>You are logged in! Start tracking your fitness activities.</p>
    </div>
  );
};

export default Dashboard;
